function setColor(el, a) {
    if (selectedColorButton) selectedColorButton.classList.remove("sel")
    selectedColorButton = el;
    el.classList.add("sel")
    if (selectedColorPane) {
        vehicleCache[selectedBus].colors[selectedColorPane] = a
        if(selectedColorPane === "body" && editorWindow) {
            editorWindow.postMessage({ type: 'updateChassisColor', data: { color: a}}, '*');
        } 
        document.getElementById(selectedColorPane + "Pane").style.backgroundColor = a
        vehicleCache[selectedBus].textures.forEach(tex => {
            if (!tex.paintRules) return;
            if (paintRulesCache[tex.paintRules][selectedColorPane]) paint(paintRulesCache[tex.paintRules][selectedColorPane], a);
        })
        if(selectedColorPane === "body") refreshOverlayLayer()
    }
}

function setSeat(el, a, z) {
    if (selectedSeatButton) selectedSeatButton.classList.remove("sel")
    selectedSeatButton = el;
    el.classList.add("sel")
    if (seatSelectPane.style.display !== "none") {
        vehicleCache[selectedBus].colors.seat = a;
        document.getElementById("seatPane").src = (z ? a : "data/textures/seat/" + a + ".png")
        if (document.getElementById("seatPane").complete) {
            paintSeat()
        } else {
            document.getElementById("seatPane").onload = paintSeat
        }
    }
}

function setFloor(el, a, z) {
    if (selectedFloorButton) selectedFloorButton.classList.remove("sel")
    selectedFloorButton = el;
    el.classList.add("sel")
    if (floorSelectPane.style.display !== "none") {
        vehicleCache[selectedBus].colors.seat = a;
        document.getElementById("floorPane").src = (z ? a : "data/textures/floor/" + a + ".png")
        if (document.getElementById("floorPane").complete) {
            paintFloor()
        } else {
            document.getElementById("floorPane").onload = paintFloor
        }
    }
}

function paintSeat() {
    currentImageCache["seat.png"].ctx.drawImage(document.getElementById("seatPane"), 0, 0, 1024, 1024)
    currentImageCache["seat.png"].texture.needsUpdate = true
}

function paintFloor() {
    let img = document.getElementById("floorPane")
    currentImageCache["floor.png"].ctx.drawImage(img, 0, 0, img.naturalWidth, img.naturalHeight)
    currentImageCache["floor.png"].ctx.drawImage(img, img.naturalWidth, 0, img.naturalWidth, img.naturalHeight)
    currentImageCache["floor.png"].texture.needsUpdate = true
}

function paint(rules, a) {
    let file = currentImageCache[rules.file]
    rules._d.forEach(el => {
        switch (el._t) {
            case "r":
                file.ctx.fillStyle = a;
                file.ctx.fillRect(...el._p.concat(el._s))
                file.texture.needsUpdate = true;
                break;
            default:
                console.warn("Unknown _d type: " + a._t)
                break;
        }
    })

}


