let vehicleCache = {}

let selectedBus = ""
let sidebarDivsCache = {}

function addVehicleToSession(data, imported = false) {
    closeVehicle()
    if (selectedBus) {
        sidebarDivsCache[selectedBus].classList.remove("selected")
    }
    if (!CURRENT_SESSION.indexes[data.name]) CURRENT_SESSION.indexes[data.name] = 0;
    CURRENT_SESSION.indexes[data.name]++
    let name = data.name + " #" + CURRENT_SESSION.indexes[data.name]
    let id = data.id + "_" + CURRENT_SESSION.indexes[data.name];
    if(!imported) data = structuredClone(data)
    vehicleCache[id] = {
        mode: data.mode || "lhd", displayName: name, ...data
    }
    CURRENT_SESSION.vehicles[id] = vehicleCache[id]
    let div = document.createElement("div")
    div.id = "bus"
    if(!imported) div.classList.add("selected")

    let input = document.createElement("input")
    input.classList.add("name")
    input.value = name
    input.addEventListener("input", () => {
        vehicleCache[id].displayName = input.value
    })
    div.appendChild(input)

    let infoDiv = document.createElement("div")
    infoDiv.classList.add("info")
    let doorSelectDiv = document.createElement("div")
    doorSelectDiv.classList.add("doorSelect")
    doorSelectDiv.innerHTML = "<span>Door side:</span>"
    let lhdBtn = document.createElement("button")
    lhdBtn.innerHTML = "Right"
    if (!data.mode || data.mode === "lhd") lhdBtn.classList.add("active")
    let rhdBtn = document.createElement("button")
    rhdBtn.innerHTML = "Left"
    if (data.mode && data.mode === "rhd") rhdBtn.classList.add("active")

    lhdBtn.onclick = () => {
        if (lhdBtn.classList.contains("active")) return;
        lhdBtn.classList.add("active")
        rhdBtn.classList.remove("active")
        vehicleCache[id].mode = "lhd"
        refreshDecalLayer()
        window.renderBus(vehicleCache[id], currentImageCache)
    }
    rhdBtn.onclick = () => {
        if (rhdBtn.classList.contains("active")) return;
        alert("this feature has been temporarely disabled")
        //rhdBtn.classList.add("active")
        //lhdBtn.classList.remove("active")
        //vehicleCache[id].mode = "rhd"
        //refreshDecalLayer()
        //window.renderBus(vehicleCache[id], currentImageCache)
    }
    let delBtn = document.createElement("button")
    delBtn.innerHTML = "Delete Bus"

    delBtn.classList.add("delBtn")

    delBtn.onclick = (e) => {
        res = confirm("Delete the " + name + "?")
        if (res) {
            e.stopPropagation()
            sidebarDivsCache[id].remove()
            delete vehicleCache[id];
            hideBus()
        }
    }

    doorSelectDiv.appendChild(lhdBtn)
    doorSelectDiv.appendChild(rhdBtn)

    doorSelectDiv.appendChild(delBtn)
    infoDiv.appendChild(doorSelectDiv)
    div.appendChild(infoDiv)

    div.onclick = () => {
        if (!sidebarDivsCache[id]) return
        showBus(id)
    }

    sidebarDivsCache[id] = div
    sidebar.appendChild(div)
    if(!imported) showBus(id);
    if(imported) vehicleCache[id].refreshOnLoad = true
}

function hideBus() {
    selectedBus = null
    colour.style.display = "none"
    renderBus()
}

rgb = (r, g, b) => '#' + (1 << 24 | r << 16 | g << 8 | b).toString(16).slice(1)

function showColorPane(el) {
    let col = vehicleCache[selectedBus].colors[el];
    floorSelectPane.style.display = "none";
    seatSelectPane.style.display = "none";
    decalSelectPane.style.display = "none"
    overlaySelectPane.style.display = "none"
    if (selectedColorButton) selectedColorButton.classList.remove("sel")
    colorSelectPane.querySelector(".elements").childNodes.forEach(n => {
        if (eval(n.style.backgroundColor) === col) {
            n.classList.add("sel")
            selectedColorButton = n
        }
    })
    colorSelectPane.style.display = ""
    selectedColorPane = el;
}

function showImagePane(el) {
    let col = vehicleCache[selectedBus].colors[el];
    if (el === "seat") {
        colorSelectPane.style.display = "none";
        floorSelectPane.style.display = "none";
        decalSelectPane.style.display = "none"
        overlaySelectPane.style.display = "none"
        if (selectedSeatButton) selectedSeatButton.classList.remove("sel")
        seatSelectPane.querySelector(".elements").childNodes.forEach(n => {
            if (!n.childNodes || n.childNodes.length !== 1) return
            if (n.childNodes[0].src.split("/").slice(-1)[0] === col + ".png") {
                n.classList.add("sel")
                selectedSeatButton = n
            }
        })
        seatSelectPane.style.display = ""
    } else if (el === "floor") {
        colorSelectPane.style.display = "none";
        seatSelectPane.style.display = "none";
        decalSelectPane.style.display = "none"
        overlaySelectPane.style.display = "none"
        if (selectedFloorButton) selectedFloorButton.classList.remove("sel")
        floorSelectPane.querySelector(".elements").childNodes.forEach(n => {
            if (!n.childNodes || n.childNodes.length !== 1) return
            if (n.childNodes[0].src.split("/").slice(-1)[0] === col + ".png") {
                n.classList.add("sel")
                selectedFloorButton = n
            }
        })
        floorSelectPane.style.display = ""
    }

}

async function showBus(id) {
    if (selectedBus === id) return;
    if (selectedBus) sidebarDivsCache[selectedBus].classList.remove("selected")
    selectedBus = id;
    sidebarDivsCache[id].classList.add("selected")
    await window.renderBus(vehicleCache[id])
    console.log(id)
    if (!id || id === null) {
        colour.style.display = "none"
        return;
    }
    colour.style.display = "flex"
    colorSelectPane.style.display = "none"
    floorSelectPane.style.display = "none"
    seatSelectPane.style.display = "none"
    decalSelectPane.style.display = "none"
    decalSelectPane.querySelector(".decalSettings").style.display = "none"
    decalSelectPane.querySelector("#addedDecals").innerHTML = '<span class="note"><i>No decals have been added</i></span>'
    if (vehicleCache[id].decals && Object.values(vehicleCache[id].decals).length > 0) {
        decalSelectPane.querySelector("#addedDecals").querySelector(".note").style.display = "none"
        Object.values(vehicleCache[id].decals).forEach(decal => {
            decalSelectPane.querySelector("#addedDecals").appendChild(decal._el)
        })
    }
    overlaySelectPane.querySelector(".decalSettings").style.display = "none"
    overlaySelectPane.querySelector("#addedDecals").innerHTML = '<span class="note"><i>No decals have been added</i></span>'
    if (vehicleCache[id].overlays && Object.values(vehicleCache[id].overlays).length > 0) {
        overlaySelectPane.querySelector("#addedDecals").querySelector(".note").style.display = "none"
        Object.values(vehicleCache[id].decals).forEach(decal => {
            overlaySelectPane.querySelector("#addedDecals").appendChild(decal._el)
        })
    }
    // loads painting rules
    await Promise.all(vehicleCache[id].textures.map(async tex => {
        if (paintRulesCache[tex.paintRules] || !tex.paintRules) return
        paintRulesCache[tex.paintRules] = await fetch("data/paintRules/" + tex.paintRules).then(r => r.json())
    }))

    let seat = vehicleCache[id].colors.seat;
    let floor = vehicleCache[id].colors.floor;
    // loads colours lmfao
    colour.querySelector("#mainColor .colSel").style.backgroundColor = vehicleCache[id].colors.body
    colour.querySelector("#poleColor .colSel").style.backgroundColor = vehicleCache[id].colors.pole
    colour.querySelector("#stopButton .colSel").style.backgroundColor = vehicleCache[id].colors.stop
    colour.querySelector("#seatSel .imageSel img").src = (seat.startsWith("data:image") ? seat : "data/textures/seat/" + seat + ".png")
    colour.querySelector("#floorSel .imageSel img").src = (floor.startsWith("data:image") ? floor : "data/textures/floor/" + floor + ".png")
    currentImageCache = {}
    vehicleCache[id].textures.forEach(tex => {
        if (imageCache[id + "_" + tex.name]) return currentImageCache[tex.name] = imageCache[id + "_" + tex.name];
        imageCache[id + "_" + tex.name] = window.getEditableTextureForBus(vehicleCache[id], tex.name)
        currentImageCache[tex.name] = imageCache[id + "_" + tex.name]
        if(tex.name === "base.png") {
            let a = document.getElementById("templateDownload")
            a.href = imageCache[id + "_" + tex.name].canvas.toDataURL();
            a.download = "template.png";
        }
    })

    if(vehicleCache[id].refreshOnLoad) {
        vehicleCache[id].refreshOnLoad = false;
        paintFloor()
        paintSeat()
        vehicleCache[selectedBus].textures.forEach(tex => {
            if (!tex.paintRules) return;
            if (paintRulesCache[tex.paintRules]["body"]) paint(paintRulesCache[tex.paintRules]["body"], vehicleCache[id].colors.body);
            if (paintRulesCache[tex.paintRules]["pole"]) paint(paintRulesCache[tex.paintRules]["pole"], vehicleCache[id].colors.pole);
            if (paintRulesCache[tex.paintRules]["stop"]) paint(paintRulesCache[tex.paintRules]["stop"], vehicleCache[id].colors.stop);
        })
        refreshDecalLayer()
    }

    window.overrideBusTextures(currentImageCache)
}

