let previewImg;

// remember, clientSize is *100 
let SCALE_FACTOR = 0.002

async function refreshDecalLayer() {
    if (!selectedBus || !vehicleCache[selectedBus].decals) return
    let decalsToAdd = Object.values(vehicleCache[selectedBus].decals).sort((a, b) => a.layer - b.layer)
    let overlayimg = currentImageCache["overlay.png"]
    let ctx = overlayimg.ctx
    let canvas = overlayimg.canvas
    ctx.clearRect(0, 0, canvas.width, canvas.height)

    let localPaintRules = paintRulesCache[vehicleCache[selectedBus].textures.find(a => a.type === "overlay").paintRules]
    let faceTempCanvas = {}
    decalsToAdd.forEach(decal => {
        let img = decal._el.querySelector("img")
        let face = decal.face
        let tempCanva;
        let tempCtx;
        let facePaintRule = localPaintRules[face]
        if (!faceTempCanvas[face]) {
            tempCanva = document.createElement("canvas");
            tempCtx = tempCanva.getContext("2d");
            tempCanva.width = facePaintRule.size[0]
            tempCanva.height = facePaintRule.size[1]
            faceTempCanvas[face] = { ctx: tempCtx, canva: tempCanva }
        } else {
            tempCanva = faceTempCanvas[face].canva
            tempCtx = faceTempCanvas[face].ctx
        }

        let sizeX = facePaintRule.size[0];
        let sizeY = facePaintRule.size[1];

        let clientX = decal.pos[0]
        let clientY = decal.pos[1]
        let clientSizeX = Math.round(1024 * SCALE_FACTOR * decal.size[0])
        let clientSizeY = Math.round(1024 * SCALE_FACTOR * decal.size[1])

        let flipX = facePaintRule.flipClientX ? 100 : 0;
        let flipY = facePaintRule.flipClientY ? 100 : 0;

        let x = sizeX * Math.abs(flipX - clientX) / 100
        let y = sizeY * Math.abs(flipY - clientY) / 100


        if (vehicleCache[selectedBus].mode === "rhd" && "driverdoorroof".includes(face)) {
            let roundedX = Math.round(x - clientSizeX / 2)
            let roundedY = Math.round(y - clientSizeY / 2)
            let roundedSizeX = Math.round(clientSizeX / 2)
            let roundedSizeY = Math.round(clientSizeY / 2)
            tempCtx.save();
            tempCtx.translate(roundedX + roundedSizeX, roundedY + roundedSizeY)
            tempCtx.scale(-1, 1)
            if(img.complete && img.naturalWidth === 0) {
                tempCtx.fillStyle = "#000000"
                tempCtx.fillRect(-roundedSizeX, -roundedSizeY, clientSizeX, clientSizeY)
                tempCtx.fillStyle = "#ff00ff"
                tempCtx.fillRect(-roundedSizeX, -roundedSizeY, clientSizeX/2, clientSizeY/2)
                tempCtx.fillRect(-roundedSizeX + clientSizeX/2, -roundedSizeY + clientSizeY/2, clientSizeX/2, clientSizeY/2)
                
            } else {
                tempCtx.drawImage(img, -roundedSizeX, -roundedSizeY, clientSizeX, clientSizeY)
            }
            tempCtx.restore();
        } else {
            if(img.complete && img.naturalWidth === 0) {
                tempCtx.fillStyle = "#000000"
                tempCtx.fillRect(Math.round(x - clientSizeX / 2), Math.round(y - clientSizeY / 2), clientSizeX, clientSizeY)
                tempCtx.fillStyle = "#ff00ff"
                tempCtx.fillRect(Math.round(x - clientSizeX / 2), Math.round(y - clientSizeY / 2), clientSizeX/2, clientSizeY/2)
                tempCtx.fillRect(Math.round(x), Math.round(y), clientSizeX/2, clientSizeY/2)
            } else {
                tempCtx.drawImage(img, Math.round(x - clientSizeX / 2), Math.round(y - clientSizeY / 2), clientSizeX, clientSizeY)
            }
        }

        if(selectedDecalButton === decal._el) {
            tempCtx.fillStyle = "#007fff7f"
            tempCtx.strokeStyle = "#ff0000"
            tempCtx.fillRect(Math.round(x - clientSizeX / 2), Math.round(y - clientSizeY / 2), clientSizeX, clientSizeY)
            tempCtx.strokeRect(Math.round(x - clientSizeX / 2), Math.round(y - clientSizeY / 2), clientSizeX, clientSizeY)
        }


    })
    Object.keys(faceTempCanvas).forEach(face => {
        let facePaintRule = localPaintRules[face]

        let actualWidth = facePaintRule.size[0]
        let actualHeight = facePaintRule.size[1]

        if (facePaintRule.rotate === -90 || facePaintRule.rotate === 90) {
            actualWidth = facePaintRule.size[1]
            actualHeight = facePaintRule.size[0]
        }

        ctx.save();
        ctx.translate(facePaintRule.pos[0] + actualWidth / 2, facePaintRule.pos[1] + actualHeight / 2);
        ctx.rotate(facePaintRule.rotate * Math.PI / 180);

        ctx.scale(facePaintRule.flipX ? -1 : 1, facePaintRule.flipY ? -1 : 1);
        ctx.drawImage(
            faceTempCanvas[face].canva,
            -faceTempCanvas[face].canva.width / 2,
            -faceTempCanvas[face].canva.height / 2
        );

        ctx.restore();
    })
    overlayimg.texture.needsUpdate = true


}

function refreshOverlayLayer() {
    if (!selectedBus || !vehicleCache[selectedBus].overlays) return
    let overlaysToAdd = Object.values(vehicleCache[selectedBus].overlays).sort((a, b) => a.layer - b.layer)
    let baseimg = currentImageCache["base.png"]
    let baseCtx = baseimg.ctx
    let baseCanvas = baseimg.canvas
    const layerCanvas = document.createElement("canvas");
    layerCanvas.width = baseCanvas.width;
    layerCanvas.height = baseCanvas.height;
    const layerCtx = layerCanvas.getContext("2d");
    let rules = paintRulesCache[vehicleCache[selectedBus].textures.find(a => a.type === "body").paintRules].chassis
    
    rules.forEach(r => {
        baseCtx.fillStyle = vehicleCache[selectedBus].colors.body
        console.log(r)
        baseCtx.fillRect(...r._p.concat(r._s));
    })

    overlaysToAdd.forEach(overlay => {
        rules.forEach(r => {
            if(!overlay.template) {
                layerCtx.drawImage(overlay._el.querySelector("img"), 0, 0)
            }
            console.log(overlay)
            
        })
    })

    baseCtx.drawImage(layerCanvas, 0, 0);
    baseimg.texture.needsUpdate = true;
}

