async function loadSession(sess) {
    CURRENT_SESSION.companyId = sess.companyId || null
    CURRENT_SESSION.companyName = sess.companyName || null
    document.getElementById("title").innerHTML = CURRENT_SESSION.companyName
    closeCompany()

    let decalElCache = {}

    sess.uploaded.colors.forEach(col => {
        let i2 = document.createElement("button")
        i2.style.backgroundColor = col
        i2.onclick = () => setColor(i2, i2.style.backgroundColor)
        i2.innerHTML = '<img src="assets/paint-brush.png">'
        selectedColorButton = i2
        i2.classList.add("sel")
        setColor(i2, i2.style.backgroundColor)
        colorSelectPane.querySelector(".elements").appendChild(i2)
    })
    await Promise.all(sess.uploaded.decals.map(decal => {
        return new Promise(resolve => {
            const img = new Image();
            img.onload = () => {
                const pngDataUrl = decal.content;
                const outImg = new Image();
                outImg.src = pngDataUrl;
                outImg.width = 256;
                let i2 = document.createElement("button")
                i2.appendChild(outImg)
                i2.onclick = () => addDecal(i2, decal.name, pngDataUrl, true)
                decalSelectPane.querySelector(".elements").appendChild(i2)
                decalElCache[decal.name.split(".")[0]] = i2
                resolve()
            };
            img.src = decal.content;
        })
    }))
    sess._importedVehicles = sess.vehicles
    
    Object.values(sess._importedVehicles).forEach(vec => {
        Object.keys(vec.decals).map(key => {
            let uploaded = sess.uploaded.decals.find(z => z.name.split(".")[0] === key.split("-decal_")[0])
            console.log(uploaded)
            let btn = document.createElement("button")
            btn.innerHTML = '<img src="' + (uploaded ? uploaded.content : "data/textures/decals/" + key.split("-decal_")[0] + ".png") + '">'
            btn.id = key
            decalId++;
            btn.onclick = () => selectDecal(btn)
            vec.decals[key]._el = btn
        })
        addVehicleToSession(vec, true)
    })
}

